// NotepadItem.tsx
import React from "react";

interface NotepadItemProps {
  notepad: {
    _id: string;
    title: string;
    subtitle: string;
    content: string;
  };
  onDelete: (id: string) => void;
}

const NotepadItem: React.FC<NotepadItemProps> = ({ notepad, onDelete }) => {
  return (
    <li>
      <div>{notepad.title}</div>
      <div>{notepad.subtitle}</div>
      <div>{notepad.content}</div>
      <button onClick={() => onDelete(notepad._id)}>Delete</button>
    </li>
  );
};

export default NotepadItem;
